import React from 'react'
import Button from '@restart/ui/esm/Button'
import { useHistory } from 'react-router-dom';



const Portafolio = () => {

    let history = useHistory();
    
    
    return (
        <div>
            <h1>PORTAFOLIO</h1>
            <Button onClick={() => history.push('/home') }>dale click para volver  ala pagina </Button>

            <div>
               <img src="https://instagram.fclo1-3.fna.fbcdn.net/v/t51.2885-19/s150x150/241699767_528267474931441_6079232001867627210_n.jpg?_nc_ht=instagram.fclo1-3.fna.fbcdn.net&_nc_ohc=hLuadWjJacwAX8DYeIN&tn=6FpBPUFFfvQzVSsR&edm=ABfd0MgBAAAA&ccb=7-4&oh=5e7525982c7c79d1727271db054d4df9&oe=6157AB1E&_nc_sid=7bff83"/>
           </div>
        </div>
    )
}

export default Portafolio
